  XW += x[9] * 44.009000;                  // CO2
  XW += x[10] * 15.035000;                 // CH3
  XW += x[11] * 16.043000;                 // CH4
  XW += x[12] * 33.006000;                 // HO2
  XW += x[13] * 34.014000;                 // H2O2
  XW += x[14] * 30.026000;                 // CH2O
  XW += x[15] * 31.034000;                 // CH3O
  XW += x[16] * 30.070000;                 // C2H6
  XW += x[17] * 28.054000;                 // C2H4
  XW += x[18] * 29.062000;                 // C2H5
  XW += x[19] * 14.027000;                 // CH2
  XW += x[20] * 13.019000;                 // CH
  XW += x[21] * 25.030000;                 // C2H
  XW += x[22] * 26.038000;                 // C2H2
  XW += x[23] * 27.046000;                 // C2H3
  XW += x[24] * 32.042000;                 // CH3OH
  XW += x[25] * 31.034000;                 // CH2OH
  XW += x[26] * 42.037000;                 // CH2CO
  XW += x[27] * 41.029000;                 // HCCO
  XW += x[28] * 46.069000;                 // C2H5OH
  XW += x[29] * 45.061000;                 // PC2H4OH
  XW += x[30] * 45.061000;                 // SC2H4OH
  XW += x[31] * 43.045000;                 // CH3CO
  XW += x[32] * 43.045000;                 // CH2CHO
  XW += x[33] * 44.053000;                 // CH3CHO
  XW += x[34] * 40.065000;                 // C3H4-A
