  phi_r = sc[11];
  Kc = refCinv * exp(g_RT[0] + g_RT[10] - g_RT[11]);
  k_r = k_f / Kc;
  dlnKcdT = invT * (-(h_RT[0] + h_RT[10]) + (h_RT[11]) + 1.000000);
